import React, { Component } from 'react';
import {AppParamList} from './AppParamList';
import { Parametre } from '../screens/Parametre';
import { Home } from '../screens/Home';
import { MonProfil } from '../screens/MonProfil';
import { Abonnement } from '../screens/Abonnement';
import { Rechercher } from '../screens/Rechercher';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

interface AppTabsProps {}

const Drawer = createBottomTabNavigator<AppParamList>();

export const AppTabs: React.FC<AppTabsProps> = ({}) => {
  return (
    <Drawer.Navigator drawerType='permanent'>
      <Drawer.Screen name="Home" component={Home} />
      <Drawer.Screen name="MonProfil" component={MonProfil} />
      <Drawer.Screen name="Abonnement" component={Abonnement} />
      <Drawer.Screen name="Rechercher" component={Rechercher} />
      <Drawer.Screen name="Parametre" component={Parametre} />
    </Drawer.Navigator>
  );
};

class Hidden extends Component {
  render() {
    return null;
  }
}
